import "./works.scss"

export default function Works() {
  return (
    <div className="works" id="works">
      <img src="assets/easu.png" alt="" />
      <h1>Thurgood Marshall, the one lawyer and judge that strived to protect the rights of all citizens. Marshall’s amazing legacy earned him the name “Mr. Civil Rights.” Mr. Marshall got many buildings and colleges named after him. There has also been a scholarship named after Thurgood Marshall. Marshall never got to go to his dream schools. He was rejected from the University of Maryland Law School due to his race. His physical courage, his intellectual brilliance and professional expertise, his moral strength, and his utter disregard for fame and wealth made Marshall who he was. Marshall was born into a middle-class family. Since young age, Marshall did not struggle with money, but his family was not awfully rich. Marshall was the youngest child in his family. He had one older brother named William Aubrey Marshall. William was also intelligent like Marshall but did not think being a lawyer was a professional job. </h1>
    </div>
  )
}
